import { makeStyles } from '@material-ui/core'
import React from 'react'
import { RuleSet, Tree } from '../tree-solver'
import TreeNode from './TreeNode'

interface TreeSvgProps {
  rules: RuleSet
  words: Array<{
    word: string
    pos: string
  }>
  tree: Tree
  svgRef: React.Ref<SVGSVGElement>
}

const useStyles = makeStyles(() => ({
  svg: {
    width: '100%',
    maxHeight: 'calc(100vh - 136px)',
    fontFamily: 'Roboto Mono',
    background: '#f5f5f5'
  }
}))

const TreeSvg: React.FC<TreeSvgProps> = (props) => {
  const classes = useStyles()

  return (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox={`0 100 1000 ${props.tree.nodes.filter(n => n.expanded).reduce((h, n) => Math.max(n.level + 1, h), 0) * 130}`} className={classes.svg} ref={props.svgRef}>
      <style dangerouslySetInnerHTML={{
        __html: `
        @font-face {
          font-family: 'Roboto Mono';
          font-style: normal;
          font-weight: 400;
          font-display: swap;
          src: url(data:application/font-woff;charset=utf-8;base64,) format('woff2');
          unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
        }
        @font-face {
          font-family: 'Roboto Mono';
          font-style: normal;
          font-weight: 500;
          font-display: swap;
          src: url(data:application/font-woff;charset=utf-8;base64,) format('woff2');
          unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
        }`
      }} />
      <TreeNode name={'TP'} children={props.tree.nodes.filter(n => n.expanded)} start={0} width={100} words={props.words.map(w => w.word)} rules={props.rules} />
    </svg>
  )
}

export default TreeSvg
